We want to print something to the terminal, so we're going to declare external functions for that and link with libc when we're done. This program can also be found at examples/hello_world.st in the source tree of Rusty. _start is our entry point to the program, because most linker scripts define it this way. Since we don't have a crt0 right now, we have to call the exit() function by ourselves after we're done. Otherwise, the program will most likely crash (because it tries to return to a function that never existed). @EXTERNAL FUNCTION puts : DINT
VAR_INPUT text : STRING;
END_VAR
END_FUNCTION @EXTERNAL FUNCTION exit : DINT
VAR_INPUT status : DINT;
END_VAR
END_FUNCTION FUNCTION _start : DINT puts('hello, world!'); exit(0);
END_FUNCTION

