A program is static POU with some code attached. This means that there is exactly one instance. So wherever from it is called, every caller uses the exact same instance which means that you may see the residuals of the laster caller in the program's variables when you call it yourself. PROGRAM prg VAR x : DINT; y : DINT; END_VAR END_PROGRAM The program's interface is persistent across calls, so we store it in a global variable. Therefore the code-generator creates a dedicated struct-type called prg_interface. A global variable called prg_instance is generated to store the program's state across calls. This global instance variable is passed as a this pointer to calls to the prg function. %prg_interface = type { i32, i32 } @prg_instance = global %prg_interface zeroinitializer define void @prg(%prg_interface* %this) {
entry: ret void
}

