A FunctionBlock is an POU that is instantiated in a declaration. So in contrast to Programs, a FunctionBlock can have multiple instances. Nevertheless the code-generator uses a very similar strategy. A struct-type for the FunctionBlock's interface is created but no global instance-variable is allocated. Instead the function block can be used as a DataType to declare instances like in the following example: FUNCTION_BLOCK foo VAR_INPUT x, y : INT; END_VAR
END_FUNCTION_BLOCK PROGRAM prg VAR f : foo; END_VAR
END_PROGRAM So for the given example, we see the code-generator creating a type for the FunctionBlock's state (foo_interface). The declared instance of foo, in prg's interface is seen in the program's generated interface struct-type (prg_interface). ; ModuleID = 'main'
source_filename = "main" %prg_interface = type { %foo_interface }
%foo_interface = type { i16, i16 } @prg_instance = global %prg_interface zeroinitializer define void @foo(%foo_interface* %0) {
entry: ret void
} define void @prg(%prg_interface* %0) {
entry: ret void
}

